const intialState = {
  products: [],
};

const productReducer = (state = intialState, { type, payload }) => {
  switch (type) {
    case "SET_PRODUCTS": {
      return {
        ...state,
        products: payload
      };
    }
    default:
      console.log('SET_PRODUCTS====>>>>',payload);
      return state;
    }
  };

export default productReducer;
